import React from 'react';
import logo from './logo.svg';
import './App.css';

const text = "Test "

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1 style={{
            color: 'red'
        }}>Hello World!</h1>
          <p>
              {text}
              {1}
          </p>
      </header>
    </div>
  );
}

export default App;
